DROP DATABASE IF EXISTS BTP2;
CREATE DATABASE BTP2;
USE BTP2;
CREATE TABLE pcap(id integer,timestamp float,source VARCHAR(100),destination VARCHAR(100),status VARCHAR(100),difference_time float,sequence_number VARCHAR(100),packet_length integer);
CREATE TABLE pcap_all(id integer,traced_at VARCHAR(100),timestamp float,source VARCHAR(100),destination VARCHAR(100),sequence_number VARCHAR(100),packet_length VARCHAR(100));
